Description
A minimal Debian based Linux system with fully functional bash shell (with GNU coreutils, not BusyBox), TCP/IP networking with DHCP client and APT setup to be able to install any package from the Debian repositories.  &lt;a href=&quot;
http://sourceforge.net/projects/bachatalinux/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://sourceforge.net/projects/bachatalinux/&lt;/a&gt;

*.iso files are CD-ROM images with a bootable self-contained installer. Burn on a CD-R disk and boot from it to install on a physical machine, or use directly to install in a virtual machine. *.cgz files are bundles used by the installation scripts. install-bachatalinux is a Linux shell script to install without a CD. install-bachatalinux-in-kvm-qemu is a Linux shell script to install in a KVM/QEMU virtual machine.  &lt;a href=&quot;
